import React, { Component } from 'react';
import Drone from '../assets/Drone.png';

class Header extends Component {
  render() {
    return (
      <div className="drone">
        <img src={Drone} alt="F-210 Drone"/>
      </div>
    );
  }
}

export default Drone;
